import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { Button } from "react-bootstrap";
import Menu from "./components/menu/menu";

export default function App() {
  return (
    <BrowserRouter>
      <Menu />
      <h1>Test</h1>
      <br /> <h1>Test</h1>
      <br /> <h1>Test</h1>
