      <br /> <h1>Test</h1>
      <br /> <h1>Test</h1>
      <br />
      <Routes>
        <Route path="/" element={<div>Home</div>} />
        <Route path="users/*" element={<Users />} />
      </Routes>
    </BrowserRouter>
  );
}

function Users() {
  return (
    <div>
      <nav>
        <Link to="me">My Profile</Link>
      </nav>

      <Routes>
        <Route path=":id" element={<div>Test</div>} />
        <Route path="me" element={<div>Test2</div>} />
      </Routes>
    </div>
  );
}
